import './App.css';
import NavBar from './components/navbar';
import React, {useEffect} from 'react';
import ProdcutTable from './components/producttable';
import ProModalNew from './components/newproductmodal';
import { useSelector } from 'react-redux';


const App = () => {

  const products = useSelector((state) => state.products);

  let editModals = products.map((pro) => {
    return (
        <React.Fragment>
            <ProModalNew 
                key={pro._id}
                productId={pro._id}
                name={pro.name}
                manufacturer={pro.manufacturer}
                style={pro.style}
                purchasePrice={pro.purchasePrice}
                salePrice={pro.salePrice}
                commisionPercentage={pro.commisionPercentage}
            />
        </React.Fragment>
    )
})

  return (
    <div className='bg-stone-900 min-h-screen'>
      <div>
        <NavBar />
      </div>


      <div className='place-items-center grid grid-cols-2 gap-4 text-white'>
        <div className='py-10'><ProdcutTable /></div>
        <div>02</div>
        <div>03</div>
        <div>04</div>
      </div> 

      <div className='h-full w-screen flex justify-center'>
        {editModals}
        <ProModalNew/>
      </div>
    </div>
  )
}

export default App;
